ll calc(int t) {
    if (t <= 0) {
        return 0;
    }
    if (t == 1) {
        return 1;
    }
    return 1ll * t * (t - 1) / 2 + t;
}

class Solution {
  public:
    std::vector<long long> resultArray(std::vector<int> &nums, int k) {
        std::vector<ll> res(k, 0);
        n = sz(nums);
        vi arr;
        for (int t: nums) {
            arr.push_back(t % k);
        }
        vl remainders;
        vl alter_v(k, 0);
        for (int i: rrange(n)) {
            remainders = vl(k, 0);

            // we got something here
            remainders[arr[i]] += 1;
            for (int j: range(k)) {
                int r = (arr[i] * j) % k;
                remainders[r] += alter_v[j];
            }
            // add to the global values
            for (int j: range(k)) {
                res[j] += remainders[j];
            }

            // clear the remainings when cur is 0
            if (arr[i] == 0) {
                for (int j: range(1, k)) {
                    remainders[j] = 0;
                }
            }

            alter_v = remainders;
        }

        return res;
    }
};

